const inputRadioSettings = (props) => {
    <input checked={false} tabIndex={props.activePortfolio ? -1 : 0} onChange={(e) => props.handleChangeSettings(e)} name="settings" id="default-setting" type="radio" value="default"/>
}

export default inputRadioSettings;
